  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Maine
  Coastal Islands Refuge Complex outlines Refuge accomplishments during the 1996 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  public participation, compliance with environmental and cultural resource mandates,
  and research and investigations. Refuge administration is outlined; information
  about personnel, volunteer programs, funding, and safety is given. Habitat management
  is also covered; subjects include wetlands, forests, grasslands, grazing, and wilderness
  areas. The wildlife section of the report discusses wildlife diversity, endangered
  and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, marine mammals, animal control, marking and banding, and disease control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, outdoor recreation, and law enforcement. The equipment and
  facilities section of the report provides information about new construction, rehabilitation,
  and equipment replacement. Items of interest are provided at the end. Refuge brochures
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
